function initSort() {
        
    // Array to be sorted
    var data = new Array();
    var resetted = false;
    
    // Generate array of rundom number and reset panel
    function reset() {
        for (i=0; i<50; ++i) {
            data[i] = ~~(i*160/50);
        }
        for (i=data.length-1; i>=0; --i) {
            var ridx = ~~( Math.random() * ( data.length ) );
            data.swap(i, ridx);
        }
        var tb = $("#sortPanel");
        tb.empty();
        var tr = $("<tr></tr>");
        for (i=0; i<data.length; ++i) {
            tr.append("<td  id='b"+i+"'>" +
                      "<div class='cc' style='height: "+data[i]+"px;'>" +
                      "</div></td>");
        }
        tb.append(tr);
        resetted = true;
    }
    
    //
    // Functions queue (for visualization)
    //
    var wrapFunction = function(fn, context, params) {
        return function() {
            fn.apply(context, params);
        };
    }
    
    var funqueue = [];
    
    function swapS(a, b) {
        var ca = $("#b"+a).children("div");
        var cb = $("#b"+b).children("div");
        ca.removeClass("cc").addClass("ccH1");
        cb.removeClass("cc").addClass("ccH2");
    }
    
    function swapP(a, b) {
        var ca = $("#b"+a).children("div");
        var cb = $("#b"+b).children("div");
        $("#b"+a).empty().append(cb);
        $("#b"+b).empty().append(ca);
    }
    
    function swapU(a, b) {
        var ca = $("#b"+a).children("div");
        var cb = $("#b"+b).children("div");
        ca.removeClass("ccH2").addClass("cc");
        cb.removeClass("ccH1").addClass("cc");
    }
    
    var memV;
    function push(a) {
        memV = $("#b"+a).children("div");
    }
    
    function pop(a) {
        $("#b"+a).empty().append(memV)
    }
    
    function moveP(a, b) {
        var ca = $("#b"+a).children("div");
        $("#b"+b).empty().append(ca);
    }
    
    function pushSwap(a, b) {
        var fun1 = wrapFunction(swapS, this, [a, b]);
        var fun2 = wrapFunction(swapP, this, [a, b]);
        var fun3 = wrapFunction(swapU, this, [a, b]);
        funqueue.push(fun1);
        funqueue.push(fun2);
        funqueue.push(fun3);
    }
    
    var intQueue;
    
    function runQueue() 
    {
        if (funqueue.length > 0) {
            (funqueue.shift())();
        } else {
            clearInterval(intQueue);
            $(".button").removeClass("disable");
            resetted = false;
        }
    }
    //
    // Functions queue end
    //
    
    //
    // Array extension for values swapping
    //
    Array.prototype.swap = function(a, b) {
        var t = this[a];
        this[a] = this[b];
        this[b] = t;
    }
    
    //
    // Array extension for values swapping with display
    //
    Array.prototype.swapVerbose = function(a, b) {
        pushSwap(a, b);
        this.swap(a, b);
    }
    
    //
    // Bubble sort
    //
    var bubble = {
        a: null,
        sort: function(arr) {
            intQueue = setInterval(function(){runQueue()},0);
            this.a = arr.slice();;
            for (i = this.a.length; i > 0; i--)
            {
                if (this.a[i] < this.a[i-1])
                {
                this.a.swapVerbose(i-1, i);
                i = this.a.length;
                }
            }
            return this.a;
        }
    }
    
    //
    // Insertion sort
    //
    var insertionsort = {
            a: null,
            sort: function(arr) {
                this.a = arr.slice();
                intQueue = setInterval(function(){runQueue()},0);
                var j, v;
                for (var i = 1; i < this.a.length; i++) {
                    j = i;
                    funqueue.push(wrapFunction(swapS, this, [i, i]));
                    funqueue.push(wrapFunction(push, this, [i]));
                    v = this.a[i];
                    while ((this.a[j-1] > v) && (j > 0)) {
                        funqueue.push(wrapFunction(swapS, this, [j-1, j-1]));
                        funqueue.push(wrapFunction(moveP, this, [j-1, j]));
                        funqueue.push(wrapFunction(swapU, this, [j, j]));
                        this.a[j] = this.a[j-1];
                        j--;
                    }
                    funqueue.push(wrapFunction(pop, this, [j]));
                    funqueue.push(wrapFunction(swapU, this, [j, j]));
                    this.a[j]=v;
                }
                return this.a;            
            }
    }
    
    //
    // Selection sort
    //
    var selectionsort = {
       a: null,
       sort: function(arr) {
            this.a = arr.slice();
            intQueue = setInterval(function(){runQueue()},0);
            for (var i = 0; i < this.a.length; i++)
            {
                max = i;
                for (var j = i+1; j < this.a.length; j++)
                {
                    if (this.a[j] < this.a[max])
                        max = j;
                }
                this.a.swapVerbose(i, max);
            }
       }
    }
    
    //
    // Quick sort
    //
    var quick = {
        a: null,
        sort: function(arr) {
            intQueue = setInterval(function(){runQueue()},0);
        this.a = arr.slice();
        this.qsort(0, this.a.length -1);
        return this.a;
        
        },
        part: function(p, r) {
        var v = this.a[p];
        var i = p;
        var j = r;
        while (true) {
            while (this.a[j] > v) j--;
            while (this.a[i] < v) i++;
            if (i < j)
            {
            this.a.swapVerbose(i, j);
            i++;
            j--;
            } else { 
            return j;
            }
        }
        },
        qsort: function(p, r) {
        if (p < r)
        {
            var q = this.part(p, r);
            this.qsort(p, q);
            this.qsort(q+1, r);
        }
        }
    }
    
    //
    // Heap sort
    //
    var heap = {
        n: 0,
        a: null,
        shiftDown: function (l, i) {
            var k = i;
            var j = -1;
            while (j != k) {
                j = k;
                j2  = 2*j;
                j21 = 2*j+1;
                if (j2 < l && this.a[j2] > this.a[k])
                    k = j2;
                if (j21 < l && this.a[j21] > this.a[k])
                    k = j21;
                this.a.swapVerbose(j, k);
            }
        },
        sort: function (arr) {
            intQueue = setInterval(function(){runQueue()},0);
            this.a = arr.slice();
            this.n = this.a.length-1;
    
            // build heap
            for (var i = ~~(this.n/2); i >= 0; i--) {
                this.shiftDown(this.n, i);
            }
            // sort heap
            for (var i = this.n; i > 0; i--) {
                this.a.swapVerbose(0, i);
                this.shiftDown(i-1, 0);
            }
            if (this.a[0] > this.a[1])
                this.a.swapVerbose(0, 1);
            return this.a;
        }
    }
    
    reset();
}
function initEntity() {
    $(".ent").draggable({   
    containment: 'body',   
    scroll: false 
    });
     
    var lmb = false;
    
    $(".ent").mousedown(function(e){
        if(e.which === 1) lmb = true;
    });
    
    $(".ent").mouseup(function(e){
        if(e.which === 1) lmb = false;
    });
     
    $(".ent").mousemove(function(e) {
        if (e.which === 1 && lmb) {
        	calculate();
        }
    });
     
     calculate = function() {
     
     	$(".ent").each(function() {
     		var ent = $(this);
     		if ($(this).children(".fk").length != 0) {
     			$(this).children(".fk").children("li").each(function() {
     				var tbName = $(this).attr("fk");
     				var rt = $("#"+tbName);
     				
     				if ($("#rel"+tbName).length == 0) {
     					var rel = $("<div class='rel'></div>");
    					rel.attr("id", "rel"+tbName)
     				}
     				else
     					var rel = $("#rel"+tbName);
     				
     				var sx = ent.offset().left + Math.round(ent.outerWidth() /2);
     				var sy = ent.offset().top  + Math.round(ent.outerHeight()/2);
     				var ex = rt .offset().left + Math.round(rt .outerWidth() /2);
     				var ey = rt .offset().top  + Math.round(rt .outerHeight()/2);
     				
     				var t,l;
     				if (sy > ey) t = ey; else t = sy;
     				if (sx > ex) {
     					l = ex;
     				} else {
    					l = sx;
    				}
    				
    				var cx = sx - ex;
    				var cy = sy - ey;
    				if ((cx>=0) && (cy>=0)) {
    					rel.toggleClass("relRT", true);
    					rel.toggleClass("relLB relRB relLT", false);
    				} else if ((cx>0) && (cy<0)) {
    					rel.toggleClass("relRB", true);
    					rel.toggleClass("relLB relLT relRT", false);									
    				} else if ((cx<0) && (cy>0)) {
    					rel.toggleClass("relLT", true);
    					rel.toggleClass("relLB relRT relRB", false);
    				} else if ((cx<0) && (cy<0)) {
    					rel.toggleClass("relLB", true);
    					rel.toggleClass("relLT relRT relRB", false);
    				}
    
     				rel.offset({top: t, left: l});
     				rel.height(Math.abs(ey - sy));
     				rel.width (Math.abs(ex - sx));
    
     				$("body").append(rel);
     			});
     		}
     	});
     }
     
     calculate();

}
function initMeze() {

  $.getScript("https://cdnjs.cloudflare.com/ajax/libs/kineticjs/5.2.0/kinetic.min.js", function(data, textStatus, jqxhr) {
    // console.log(data);
		// console.log(textStatus);
		// console.log(jqxhr.status);
		mazeGen.init();				
		
		$("#btStart").click(function() {
			
			if (!$("#btStart").hasClass("disable"))
			{
				$("#btStart").addClass("disable");
				$("#btStop").removeClass("disable");
				$("#btClear").addClass("disable");
				mazeGen.start();
			}
		});
		$("#btStart").toggleClass("disable");
		
		$("#btStop").click(function() {
			if (!$("#btStop").hasClass("disable")) {
				$("#btStart").removeClass("disable");
				$("#btStop").addClass("disable");
				$("#btClear").removeClass("disable");
				mazeGen.stop();
			}
		});
		
		$("#btClear").click(function() {
			if (!$("#btClear").hasClass("disable"))
				mazeGen.clear();
		});
	});

	Array.prototype.contains = function(idx) {
		var fIdx = -1;
		for(var i = 0; i < this.length; i++) {
			if(this[i].idx == idx) {
				fIdx = i;
				break;
			}
		}
		return fIdx;
	}

	Array.prototype.getByIndex = function(idx) {
		var obj = null;
		for(var i = 0; i < this.length; i++) {
			if(this[i].idx == idx) {
				obj = this[i];
				break;
			}
		}
		return obj;
	}
	
	Array.prototype.clearAll = function() {
		this.splice(0,this.length);
	}
	
	var elemShape = function(aX, aY) {
		return new Kinetic.Rect({
			x : aX,
			y : aY,
			width : 10,
			height : 10,
			fill : "transparent",
			stroke : "transparent",
			strokeWidth : 0
		});
	}

	/* *** */
	
	var mazeGen = { 
	
		interval: null,
		stage: null,
		layer: null,
			
		vertex: new Array(),
		adjacent: new Array(),
		emptyBox: new Array(),

		intervalSwitch: true,
		adjCurr: new Array(),
		v: null,
		a: null,
		color1: "#FA7000",
		color2: "#ddd",

		generateGraph: function() {
			var w = 57;
			var h = 17;

			for(var r = 0; r < h; r++)
			for(var c = 0; c < w; c++) {
				var vIdx = r * w + c;

				if($.inArray(vIdx, mazeGen.emptyBox) > -1) {
					mazeGen.layer.add(elemShape(c * 10, r * 10));
				} else if(mazeGen.adjacent.contains(vIdx) == -1) {

					var v = {
						shape : elemShape(c * 10, r * 10),
						idx : vIdx,
						adj : new Array()
					};

					for( ar = r - 1; ar < r + 2; ar++)
					for( ac = c - 1; ac < c + 2; ac++) {
						var aIdx = ar * w + ac;
						if(aIdx == v.idx)
							continue;
						if((ac < 0) || (ar < 0) || (ac >= w) || (ar >= h))
							continue;
						if((ac != c) && (ar != r)) {
							mazeGen.emptyBox[mazeGen.emptyBox.length] = aIdx;
							continue;
						}

						v.adj[v.adj.length] = aIdx;
						var aPos = mazeGen.adjacent.contains(aIdx);
						if(aPos == -1) {
							var adj = {
								idx : aIdx,
								shape : elemShape(ac * 10, ar * 10),
								w : Math.floor(Math.random() * 11),
								v1 : vIdx
							};
							mazeGen.adjacent[mazeGen.adjacent.length] = adj;
							mazeGen.layer.add(adj.shape);
						} else {
							mazeGen.adjacent[aPos].v2 = vIdx;
						}
					}
					mazeGen.vertex[mazeGen.vertex.length] = v;
					mazeGen.layer.add(v.shape);
				}
			}
		},
		
		generateMaze: function() {
			if(mazeGen.vertex.length <= 1) {
				clearInterval(mazeGen.interval);
				$("#btStart").removeClass("disable");
				$("#btStop").addClass("disable");
				$("#btClear").removeClass("disable");
				mazeGen.a.shape.setFill(mazeGen.color2);
				mazeGen.vertex[0].shape.setFill(mazeGen.color2);
				mazeGen.layer.draw();
				return;
			}
			mazeGen.v.shape.setFill(mazeGen.color1);
			if(mazeGen.a)
				mazeGen.a.shape.setFill(mazeGen.color2);
			mazeGen.layer.draw();

			if(mazeGen.intervalSwitch) {
				mazeGen.intervalSwitch = false;
				return;
			}

			for( s = 0; s < mazeGen.v.adj.length; s++) {
				if(mazeGen.adjacent.contains(mazeGen.v.adj[s]) > -1)
					mazeGen.adjCurr[mazeGen.adjCurr.length] = mazeGen.adjacent.getByIndex(mazeGen.v.adj[s]);
			}

			mazeGen.v.shape.setFill(mazeGen.color2);
			var tmp = mazeGen.vertex.splice(mazeGen.vertex.contains(mazeGen.v.idx), 1);

			if((mazeGen.vertex.length > 0) && (mazeGen.adjacent.length > 0)) {

				mazeGen.adjCurr.sort(function(pa, pb) {
					return pa.w - pb.w
				});
				for(var ac = 0; ac < mazeGen.adjCurr.length; ac++) {
					var v1 = mazeGen.adjCurr[ac].v1;
					var v2 = mazeGen.adjCurr[ac].v2;
					var cv1 = (mazeGen.vertex.contains(v1) > -1);
					var cv2 = (mazeGen.vertex.contains(v2) > -1);

					if(cv1 || cv2) {
						mazeGen.v = mazeGen.vertex.getByIndex([( cv1 ? mazeGen.adjCurr[ac].v1 : mazeGen.adjCurr[ac].v2)]);
						mazeGen.adjCurr[ac].shape.setFill(mazeGen.color1);
						mazeGen.a = mazeGen.adjCurr[ac];
						mazeGen.layer.draw();
						mazeGen.adjacent.splice(mazeGen.adjacent.contains(mazeGen.adjCurr[ac].idx), 1)
						mazeGen.adjCurr.splice(ac, 1);
						break;
					}
				}
			}
			mazeGen.intervalSwitch = true;
		},
		init: function() {
			mazeGen.stage = new Kinetic.Stage({
				container : "canvas",
				width : 590,
				height : 190
			});
			mazeGen.layer = new Kinetic.Layer();
			mazeGen.stage.add(mazeGen.layer);
			mazeGen.generateGraph();
			mazeGen.v = mazeGen.vertex[0];
			mazeGen.a = null;
		},
		clear: function() {
			mazeGen.layer.removeChildren();
			mazeGen.stage.clear();
			
			mazeGen.vertex.clearAll();
			mazeGen.adjacent.clearAll();
			mazeGen.emptyBox.clearAll();
			
			mazeGen.intervalSwitch = true;
			mazeGen.adjCurr.clearAll();
			mazeGen.generateGraph();

			mazeGen.v = mazeGen.vertex[0];
			mazeGen.a = null;
		},
		
		start: function() {
			
			mazeGen.interval = setInterval(function() {
				mazeGen.generateMaze();
			}, 50);
		},
		
		stop: function() {
			clearInterval(mazeGen.interval);
		}
	} // genMaze
}